import styled from "@emotion/styled";

const ScoreBoard = styled.div`
	display: grid;
	grid-template-columns: 50% 50%;
	grid-template-rows: repeat(3, auto);

	.team1 {
		grid-column-start: 0;
		width: 100%;
		text-align: center;

		.scoreButtons {
      width: 100%;
      display: grid;
      grid-template-columns: repeat(4, 25%);
      grid-template-rows: repeat(3, 80px);
      grid-gap: 4px;
      margin: 0 auto;

      .scoreButton{
			  width: 300px;
        grid-row-start: 2;
        grid-row-end: 3;
      }
		}
	}
`;

function Home() {
	return (
		<>
			<h1>Basketball Time!</h1>
			<ScoreBoard>
				<div className="team1">
					<h3 className="name">Tom</h3>
					<h2 className="score" />

					<div className="scoreButtons">
						<button className="scoreButton">3</button>
						<button className="scoreButton">2</button>
						<button className="scoreButton">1</button>
					</div>
				</div>
			</ScoreBoard>
		</>
	);
}

export default Home;
